import React from 'react';
import './Filter.css';

function Filter() {
  return (
    <div>
        <span className='filter'>Filter Games</span>
        <div className='filterFields'>
            <label name='bullet'></label>
            <button type='radio' name='bullet'>bullet</button>
        </div>
    </div>
  )
}

export default Filter;
